            list.Add("[ds_company_issuer_name]", danfeNFe.Emitente.Nome);
            var endereco = $"{danfeNFe.Emitente.Endereco.NomeEnd} {danfeNFe.Emitente.Endereco.Num}";
            var fone = string.IsNullOrWhiteSpace(danfeNFe.Emitente.Endereco.Tel)
                    ? ""
                    : $"{danfeNFe.Emitente.Endereco.Tel.FormatarTelefone()}";
            var bairro = $"{danfeNFe.Emitente.Endereco.Bairro}";
            var cep = $"{danfeNFe.Emitente.Endereco.Cep}";
            var cidade = $"{danfeNFe.Emitente.Endereco.Cidade}";
            var uf = $"{danfeNFe.Emitente.Endereco.Uf}";
