            list.Add("[ds_company_uf]", uf);
            list.Add("[nl_company_phone_number]", fone);
            list.Add("[ds_danfe]", string.IsNullOrEmpty(danfeNFe.Chave) ? string.Empty : danfeNFe.Chave.FormatarEspaco(4));
